import React from 'react';
import { NavLink } from 'react-router-dom';
import './publi?/Navbar.css'; // Make sure to create this CSS file

const Navbar = () => {
    return (
        <nav className="navbar">
            <ul className="nav-links">
                <li><NavLink to="/" activeClassName="active-link">Home</NavLink></li>
                <li><NavLink to="/marbles" activeClassName="active-link">Marbles</NavLink></li>
                <li><NavLink to="/granites" activeClassName="active-link">Granites</NavLink></li>
                <li><NavLink to="/tabletops" activeClassName="active-link">Table Tops</NavLink></li>
                <li><NavLink to="/bowls" activeClassName="active-link">Bowls</NavLink></li>
                <li><NavLink to="/stones" activeClassName="active-link">Stones</NavLink></li>
            </ul>
        </nav>
    );
};

export default Navbar;
